import React from "react";

const App = () => {
  return (
    <>
      <div style={{ textAlign: "center" }}>
        <h1>Increment Decrement Challenge</h1>
        <h1>0</h1>
        <button>+</button>
        <button>-</button>
      </div>
    </>
  );
};

export default App;
